script: |
  super -f text -I q13013.spq | sort > q13013.out

inputs:
  - name: q13013.spq
    data: |
      SELECT DISTINCT col1 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( ( + col2 * col0 + 28 BETWEEN ( col1 ) AND 58 * col1 ) );
  - name: tab2

outputs:
  - name: q13013.out
    data: |
      67
